import { Component } from '@angular/core';

@Component({
  selector: 'app-footer',
  templateUrl: './footer.component.html',
  styleUrls: ['./footer.component.css']
})
export class FooterComponent {
 footerBrand:string= "src/app/assets/images/footer-logo.png"
 socialLink:string= "src/app/assets/images/social-footer.png"
}
<footer>
    <img [src]="footerBrand" width="50">
  <ul class="flex-flow" style="list-style: none; font-weight: 200; font-size: 18px;"><li><a>Home</a></li><li><a>Key Features</a></li><li><a>Pricing</a></li><li><a>Testimonial</a></li><li><a>Home</a></li><li><a>FAQ</a></li></ul>  
  <img [src]="socialLink" width="30">
  <p style="color:#5f636e; font-size: 18px;">Copyright@ Arifur Rahman Tushar 2019 All rights reserved</p>
</footer>
